#include <stdio.h>

typedef struct {
    int x, y;
} Point;

int cross_product(Point p0, Point p1, Point p2) {
    return (p1.x - p0.x) * (p2.y - p0.y) - (p2.x - p0.x) * (p1.y - p0.y);
}

int main() {
    int q;
    scanf("%d %d %d %d", &q[0], &q[1], &q[2], &q[3]);
    Point p0 = {q[0], q[1]};
    Point p1 = {q[2], q[3]};

    int n;
    scanf("%d", &n);
    for (int i = 0; i < n; i++) {
        int x, y;
        scanf("%d %d", &x, &y);
        Point p2 = {x, y};

        int cp = cross_product(p0, p1, p2);
        if (cp > 0) {
            printf("COUNTER_CLOCKWISE\n");
        } else if (cp < 0) {
            printf("CLOCKWISE\n");
        } else {
            if ((p1.x - p0.x) * (p2.y - p0.y) - (p2.x - p0.x) * (p1.y - p0.y) == 0) {
                if ((p2.x - p0.x) * (p2.x - p0.x) + (p2.y - p0.y) * (p2.y - p0.y) == (p1.x - p0.x) * (p1.x - p0.x) + (p1.y - p0.y) * (p1.y - p0.y)) {
                    printf("ON_SEGMENT\n");
                } else if ((p2.x - p0.x) * (p1.y - p0.y) - (p2.y - p0.y) * (p1.x - p0.x) > 0) {
                    printf("ONLINE_BACK\n");
                } else {
                    printf("ONLINE_FRONT\n");
                }
            }
        }
    }

    return 0;
}
